import React from 'react'
import {Navigate, Outlet} from 'react-router-dom'
const PrivateRoutes = () => {
    let token = localStorage.getItem('access_token') || false;
  return (
    token?<Outlet/>:<Navigate to = '/admin/login'/>
  )
}

export default PrivateRoutes
